[{'action': 'opened', 'author': 'sougou', 'comment_id': None, 'datetime': '2021-01-22 21:31:33+00:00', 'masked_author': 'username_0', 'text': 'From @jmoldow:

Can you also discuss the relationship between backups and the recommended max/min/avg/median shard sizes?

Could you possibly also discuss the pros/cons between manually maintaining your keyspace id partitionings, vs. doing an even power-of-2 partitioning? And the kind of scenarios where the former would be required (region sharding, poorly-chosen sharding key with hotspots, etc.)', 'title': 'vschema user guide doc request', 'type': 'issue'}
